import React, { Component } from 'react';

import Icon, { FontAwesome, Feather } from 'react-web-vector-icons';
require('react-web-vector-icons/fonts');

class CollaboratorList extends Component {
  constructor(props) {
    super(props);
  
    this.state = {
      toggleEdit: []
    };
  }

  render() {
    const {favorite, user} = this.props;

    const renderCollaborator = () => {
      return favorite.collaborator.map((item, key) => 
        <div style={{border: '1px solid black', borderRadius: 10}}>
          <label>{item}</label>
          <Feather
            name='award'
            color='#007ACC'
            size={40}
            // style={{}}
          />
          <FontAwesome
            name='plane'
            color='cyan'
            size={50}
          />
          <Icon
            name='stackoverflow'
            font='Zocial'
            color='black'
            size={100}
          />
        </div>
      )
    };

    return (
      <div>
        {renderCollaborator()}
      </div>
    );
  }
}

export default CollaboratorList;
